import { BrowserRouter, Route, Link, Switch } from "react-router-dom";
import React, {Component} from "react";
import './App.css';
import DocumentTitle from 'react-document-title'
import TestPri from "./testpriziv";
import FullPriziv from "./fullpriziv";
import Priziv from "./priziv";
import Vibor from "./vibor";
import Back from "./back";

function App() {
  return (
      <DocumentTitle title = 'Voencomat'>
        <div className="App">
          <BrowserRouter basename="/">
            <ul>
              <li>
                <Link to="/priziv">Призывники</Link>
              </li>
              <li>
                <Link to="/:surname">Этот</Link>
              </li>
            </ul>
            <Switch>
              <Route exact path="/">
                <Vibor/>
              </Route>
              <Route path="/priziv">
                <TestPri/>
                <Back/>
              </Route>
              <Route path="/:surname" render={routeProps => <FullPriziv prizivnik={prizivnik} {...routeProps}/>} />
            </Switch>
          </BrowserRouter>
        </div>
      </DocumentTitle>
  );
}

export default App;
